import React from 'react';

import logo from "../../assets/logo.png"

import './footer.css';

const Footer = () => (
    <div className='footer'>
        <img src={logo} alt="logo"></img>
        <p> Creator: Yohyun Cho</p>
    </div>
)

export default Footer;
